import React from 'react';
import '../../App.scss';
//import '../NewList/NewList.scss';

export default function NewList({comments}) {
    return (
        <div>
            {comments.map(input => 
            <div key={input.id}>
              <div className="comment__image">{input.image}</div>
              <h3>{input.name}</h3>
              <p>{input.date}</p>
              <p>{input.comment}</p>
            </div>
            )}    
        </div>
    )
}
